import {auth} from "../apis";

export const login = (data) => {
    console.log("Starting login action")
    auth.login(data)
        .then((resp) => {
            console.log("resp: " + resp)
            //dispatch to store
        })
        .catch((err) => {
            console.log("err: " + err)
            //dispatch to store

        })

}
